import { Button, Grid, Typography } from '@mui/material'
import React from 'react'

const Products = () => {
  return (
    <div>
     
      <Grid style={{
        border: '1px solid black'
      }}>
         <Typography variant='h3' margin={4}> Products</Typography> <Button>add item</Button>
      </Grid>




    </div>
  )
}

export default Products
